INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10628, 'f90e3858-d6fd-4176-a607-0797c17ab2a3', 'Dla przykładu, kiedy Juliusz Cezar przybił do Afryki Północnej, olbrzymie obszary tej części były porośnięte przez lasy cedrowe i cyprysowe.', 'So for instance, when Julius Caesar arrived in North Africa, huge areas of North Africa were covered in cedar and cypress forests.', 25561);
