INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10931, '817eb26f-de64-4391-9bce-5af6ab067908', 'uzależniony od czegoś', 'addicted to sth', 26265);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10932, 'b8f0b136-e4ac-44d1-8eb8-a2480829060e', 'Należy uzależnić wszelką pomoc międzynarodową od demokratycznych zmian na Białorusi.', 'All international aid should be made dependent on democratic change in Belarus.', 26266);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10933, '34b1c001-85e5-4c49-a862-10e4d9a5f217', 'Takie opinie i wystąpienia mogą jedynie uzasadniać politykę Rosji i jej sił specjalnych.', 'Such views and talk can only support Russia''s policies and its special forces.', 26267);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10934, '1327c896-3432-4b1f-8cf4-1e8a76b32082', 'Dlatego wniosek o 5-procentowy wzrost w przyszłym budżecie jest uzasadniony i konieczny.', 'The request for a 5% increase in the next budget is therefore just and necessary.', 26268);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10935, '5920e5e0-635f-4b69-8f71-738903dae3a8', 'Dlatego musimy uzbroić się w inne instrumenty, aby bronić najbardziej poszkodowanych obywateli.', 'For this reason, we must arm ourselves with other instruments to defend the people who are hardest hit.', 26272);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10936, 'f5487476-9fae-4510-b4bb-a35ad06a2281', 'Nie bądźcież jako koń, albo jako muł, którzy rozumu nie mają, których gęby uzdą i wędzidłem kiełznać musisz, aby się na cię nie porywały.', 'Be ye not as the horse, or as the mule, which have no understanding', 26277);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10937, 'f6bea948-36ce-47f9-b128-34c16a7f4c0c', 'Ten dom z ciastek granoli ma specjalny dach z Sun Chipsów, po to, by gromadzić wodę i ją uzdatniać.', 'And the granola house has a special Sun Chip roof to collect water and recycle it.', 26278);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10938, '0feca345-677a-4519-8f66-877e35f7ed5e', 'Język słowacki jest nauczany jako język uzupełniający, przez kilka godzin tygodniowo.', 'Slovak is taught as a supplementary language for a few hours each week.', 26279);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10939, '02eb3805-e983-4d0b-8274-f49248606b53', 'Ma ona przedstawiać doskonałość, wzajemne uzupełnianie się i solidarność oraz symbolizować jedność Europy.', 'The flag is intended to represent perfection, complementarity and solidarity and to symbolise Europe''s unity.', 26280);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10940, '190f4f1c-629a-4a3b-81a0-d8744242bdf2', 'Będzie ona uzupełniać Radę ds. Energii, która również stanie się bardziej dynamiczna.', 'That will be complementary to the Energy Council, which we will re-energise as well.', 26281);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10941, '1dd52c07-14ab-47d5-bcc1-4371b9b447dc', 'Chciałbym jedynie krótko uzupełnić moją pierwszą wypowiedź.', '(DA) Mr President, I would just like briefly to add something to my first speech.', 26284);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10942, 'a8ae2291-0fd8-494b-8b93-2edc18c32114', 'Jeśli takiego zaświadczenia nie przedstawią, nikną ich szanse na uzyskanie pracy.', 'If they fail to produce such a certificate, their chances of obtaining work vanish.', 26288);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10943, '2be12c0e-4bed-4a30-a900-d14a1c5ac237', 'Należy uzyskać od producenta szczegółowe instrukcje dotyczące sposobu użycia pomp.', 'Specific instructions for using the pumps must be obtained from the manufacturer.', 26289);
