INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10945, '35fd1059-7c60-4244-b951-670902720ef3', 'Każdy, kto chce uścisnąć rękę wyciągniętą przez grupę PPE-DE, może zrobić to jutro.', 'Anyone who wants to grasp the outstretched hand of the PPE-DE Group can do so tomorrow.', 26295);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10946, 'b1f4b2c5-8177-4862-9b3b-0ce0113e8262', 'Na zakończenie prezydencji należy uściślać pochwały, a uogólniać żale.', 'At the end of a presidency, one should be specific in one''s compliments, but general in one''s regrets.', 26296);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10947, 'de16c196-cd1e-4e01-a4ff-47b3be8d7a3f', 'Więc już teraz musimy uściślić przepisy, a dopiero potem wprowadzić lepszą kontrolę.', 'Right now, then, we have to tighten up the laws and then carry out better controls.', 26297);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10948, '8c32d195-4093-499e-935f-891f779636f3', 'Dziś kiedy WNP mówi o różnorodności, tylko rosyjskie siły są obecne.', 'Today, as the CIS talks about diversity, only Russian troops are present.', 26299);
