INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10966, '34ca76ae-992b-439b-bafb-d47341f4785b', 'Być może teraz sytuacja jest inna i zdecydowana większość państw członkowskich będzie gotowa uznać, że kwestie te można wliczyć w zakres kompetencji Unii Europejskiej.', 'Now, maybe the situation has changed today and there will be a large majority of Member States thinking this can enter into the competences of the EU.', 26335);
