INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (10971, '9c244347-c4c2-4c3e-a094-dde90df90c79', 'Nie można wymazać odpowiedzialności Europy za łamanie zasad prawa oraz praw człowieka.', 'European responsibility for violations of the rule of law and human rights cannot be erased.', 26356);
