INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11000, 'd707b739-5aae-41d2-9e62-47eb6b453bc0', 'W rzadkich przypadkach, po zastosowaniu preparatu Regranex występowały pęcherze, obrzęki oraz nadmierne ziarninowanie (nadmierna produkcja tkanki w trakcie gojenia).', 'Rarely, treatment with Regranex has been associated with bullous eruption (blisters), oedema (swelling) and hypertrophic granulation (excessive production of tissue during healing).', 26409);
