INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11059, 'e9e1eb2f-467c-4d9f-8e54-a62b1fb07988', 'Ten system monitorowania powinien być zaprojektowany w sposób zapobiegający dumpingowi społecznemu.', 'This monitoring system should be specifically designed to prevent social dumping.', 26553);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11060, 'd91664eb-d937-4941-96f9-753ff35645b2', 'Sadzę, że fundusze te muszą być również stosowane w sposób zapobiegawczy.', 'It is my belief that these funds must also be used in a preventative manner.', 26554);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11061, '5cf60aa9-8ca3-4c62-bb77-aa75a2c0713b', 'Rząd Grecji musi zapewnić środki na niezwłoczne zapoczątkowanie tego programu.', 'The Greek Government must secure the capital to launch this programme immediately.', 26557);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11062, 'a1706e94-0c58-4786-9dae-589a83c2a684', 'UE musi skorzystać ze swojego wpływu na handel międzynarodowy, aby zapoczątkować zmianę.', 'The EU must exert its influence in international trade to initiate a change.', 26558);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11063, 'bf6ab26d-861b-4eac-9ff1-7ff143ecc6c4', 'Nie powinniśmy zapominać, że 99% wszystkich przedsiębiorstw europejskich to MŚP.', 'We should not forget that the SMEs represent 99% of the total European enterprises.', 26562);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11064, '150a5663-32a4-4720-a127-58bb92b31c94', 'Zaleca się zapoznanie ze standardowymi wytycznymi dotyczącymi kontrolowania dyslipidemii.', 'Consultation with standard guidelines for management of dyslipidaemia is recommended.', 26565);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11065, '123c3a37-9071-4a56-84ef-3bcffa96cb7e', 'zapoznawać się z czymś', 'to get feet wet', 26566);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11066, 'b91171da-4774-458b-9558-12402d211bf8', 'Należy zapoznać się z Charakterystyką Produktu Leczniczego dla fosaprepitantu.', 'Please refer to the Summary of Product Characteristics for fosaprepitant.', 26567);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11067, 'd0af5d34-fa6f-4b8f-a1bd-9d456def796d', 'Należy zapoznać się z Charakterystyką Produktu Leczniczego dla fosaprepitantu.', 'Please refer to the Summary of Product Characteristics for fosaprepitant.', 26568);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11068, 'a5a1a792-b9b6-42bf-ac92-600f544021b4', 'Jeśli okaże się to konieczne, należy zmniejszyć dawkę wapnia lub zaprzestać jego', 'If necessary, the calcium dose should be reduced or therapy should be discontinued.', 26570);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11069, '92c40e99-29de-4be0-bdc8-9d0ef6f0f3c2', 'Pragnę pogratulować mojemu koledze, panu posłowi Albertiniemu i zgłosić kilka uwag.', 'I would like to congratulate my colleague Mr Albertini and make a few comments.', 26572);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11070, 'ba4f61df-9739-4f75-b390-d27392eb8335', 'Czy chcieliby Państwo przedstawić uwagi na temat jakości portalu EUROPA lub zgłosić problem techniczny?', 'Would you like to comment on the quality of the EUROPA portal or report a technical problem?', 26573);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11071, 'a698670f-ae68-4104-a553-bd85946c76c7', 'Wobec braku reakcji na leczenie erytropoetyną należy zidentyfikować czynniki sprawcze.', 'Non response to erythropoietin therapy should prompt a search for causative factors.', 26576);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11072, '026fabb5-816d-493b-b041-fe30f791101b', 'Pacjenci przyjmujący lek APTIVUS nie mogą stosować preparatów zawierających ziele', 'Patients taking APTIVUS must not take products containing St John''s wort (Hypericum', 26579);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11073, '08987c48-972f-451d-a5e8-9e83e47b86b2', 'Kto ufa w bogactwach swych, ten upadnie', 'ale sprawiedliwi jako latorośl zielenieć się będą.', 26581);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11074, '93a69882-0f5d-4a67-8c73-67bc5f31149e', 'Podałeś nas jako owce na żer, a między pogan rozproszyłeś nas.', 'Thou sellest thy people for nought, And hast not increased [thy wealth] by their price.', 26583);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11075, '65df6df4-0e7e-4d4c-97da-0e3fac1f3d74', 'Ze złamanymi nogami, z pękniętą żuchwą, z wyłamanymi palcami i uszkodzoną czaszką został przewieziony do szpitala.', 'He was taken to hospital with broken legs, a shattered jaw, severed fingers and a fractured skull.', 26586);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11076, 'd5861cc6-f200-4052-96bf-907539f6fd26', 'Układ czaszkowo-żuchwowy jest krytyczny w tym przypadku.', 'The craniomandibular system is critical to that.', 26587);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11077, '5bd4b353-a230-4a10-9508-0b8533d03d5a', 'A co najlepsze, żuczek nie potrzebuje kabli pospinanych ze sobą, ciągnących się do stacji zasilania pochłaniającej paliwa kopalne.', 'And what''s more, this guy doesn''t need a wire connected all the way back to a power station burning fossil fuels.', 26588);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11078, 'c074ba50-9c64-4294-a0d9-ec5324cc0ada', 'Ten żuk potrafi wykrywać pożar lasu z 80 km.', 'This beetle can detect a forest fire at 80 kilometers away.', 26589);
INSERT INTO public."CourseDataExample" ("Id", "PublicId", "Source", "Translation", "CourseDataId") OVERRIDING SYSTEM VALUE VALUES (11079, 'd33e6868-3605-4e44-a9dd-c9aa75e78511', 'Dane farmakokinetyczne u dzieci w wieku poniżej 3 miesiąca życia są ograniczone.', 'There are limited pharmacokinetic data for patients less than three months of age.', 26591);
